/* eslint-disable react/jsx-no-undef */

import { Routes, Route } from "react-router-dom";
import Footer from "./Components/Footer";
import Navbar from "./Components/Navbar";


function App() {
  return (
      <div className="App">
          <Navbar/>
          <Routes>
            <Route path='/' element={<App/>} />
            <Route path='/home' element={<Home/>} />
          </Routes>
          <Footer/>
      </div>
  );
}

export default App;
